import React from "react";
import { createTheme, ThemeProvider } from "@material-ui/core";
import "./App.css";

const theme = createTheme({
  typography: {
    fontFamily: "neoRegular",
  },
});

function App() {
  return (
    <>
      <div className="App">
        <ThemeProvider theme={theme}>
          <AppRouter />
        </ThemeProvider>
      </div>
    </>
  );
}

export default App;
